Сервисный центр по ремонту мобильных телефонов -
м.Рыбацкое, Караваевская ул. 24 SLK-service. Телефон 454-1788.

Наши преимущества:

- быстрый, профессиональный и недорогой ремонт;
- собственный склад запчастей;
- экспресс-ремонт в присутствии клиента;
- гибкие цены;
- наличие гарантии и документов;
- особые предложения для корпоративных клиентов.

В нашей компании работают специалисты - профессионалы в области ремонта сотовых телефонов. Мы четко соблюдаем сроки, установленные на выполнение работ, уделяя особое внимание качеству.

Если Вам необходим ремонт телефонов ведущих производителей, вы всегда можете обратиться к нам.
Наши специалисты соориентируют вас по цене ремонта, звоните, 454-1788!!
